typedef struct object
{
	int x1;
	int x2;
	int y1;
	int y2;
} object;


#define ADDR_7SEG1 ((volatile long *) 0xFF200020)
#define ADDR_7SEG2 ((volatile long *) 0xFF200030)
#define PS2_BASE ((volatile long *) 0xFF200100)
#define PUSHBUTTONS ((volatile long *)0xFF200050)

volatile int* PS2_ptr = (int*)PS2_BASE;
int pixel_buffer_start;
const int start[];
const int background[];
const int board[];
const int endpage_1[];
const int endpage_2[];
int ball_x, ball_y;
int dx, dy;
int ball_size = 20;
int ball_colour = 0x06ff;
object board1, board2;
void clear_screen();
void plot_pixel(int x, int y, short int line_color);
void draw(const int array[], int xbuffer, int ybuffer, int x, int y);
void move_ball();
void display_score(int player, int index);
void check_SpacePressed();
void reset_simulation(int direction);
void set_ball_direction();
void move_board(object* cur_board, int direction);
int game_start();
int key_pressed();
int check_collide();


int main(void)
{
	clear_screen();
	bool gameStart = false;
	*(PS2_ptr) = 0xFF;
	draw(start, 0, 0, 240, 320);
	display_score(0, 0);
	display_score(1, 0);
	while (key_pressed() != 4) {}
	while (1) {
		gameStart = true;
		if (gameStart) {
			bool win = game_start();
			//game ends, now print the result
			if (win == 1) {
				draw(endpage_1, 0, 0, 240, 320);
			}
			else {
				draw(endpage_2, 0, 0, 240, 320);
			}
			while (key_pressed() != 4) {}
			//reset scores on hex display 
			gameStart = false;
		}
	}
}

int game_start() {
	int player1_score = 0;
	int player2_score = 0;
	display_score(0, player1_score);
	display_score(1, player2_score);
	reset_simulation(0);
	while (player1_score != 3 && player2_score != 3) {
		long PBval = *PUSHBUTTONS;
		while ((PBval & 1) == 1) {
			PBval = *PUSHBUTTONS;
		}
		move_ball();
		int key = key_pressed();
		if (key != -1) {
			if (key < 2)
				move_board(&board1, key);
			else
				move_board(&board2, key - 2);
		}
		if (check_collide() == 0) {
			player2_score++;
			display_score(1, player2_score);
			reset_simulation(1);
		}
		else if (check_collide() == 1) {
			player1_score++;
			display_score(0, player1_score);
			reset_simulation(2);
		}
		for (int i = 0; i < 180000; i++) {} // Adjust this value for slower animation
	}
	if (player1_score == 3)
		return 0;
	else if (player2_score == 3)
		return 1;
	return -1;
}

int check_collide() {
	if (dx < 0) {
		if (ball_x == 10) {
			if ((ball_y - 10 <= board1.y2) && (ball_y + ball_size + 10 >= board1.y1)) {
				dx = -dx;
			}
		}
		else if (ball_x == 1) {
			return 1;
		}
	}
	else {
		if (ball_x + ball_size == 310) {
			if ((ball_y - 10 <= board2.y2) && (ball_y + ball_size + 10 >= board2.y1)) {
				dx = -dx;
			}
		}
		else if (ball_x + ball_size == 319) {
			return 0;
		}
	}
	return -1;
}

void reset_simulation(int direction) {
	draw(background, 0, 0, 240, 320);
	draw(board, 95, 2, 50, 7);
	draw(board, 95, 311, 50, 7);
	board1.x1 = 2, board1.x2 = 2 + 7, board1.y1 = 95, board1.y2 = 95 + 50;
	board2.x1 = 311, board2.x2 = 311 + 7, board2.y1 = 95, board2.y2 = 95 + 50;
	ball_x = 160, ball_y = 120;
	set_ball_direction();
	if (direction == 1)
		dx = -1;
	else if (direction == 2)
		dx = 1;
}

void move_board(object* cur_board, int direction) {
	if (direction == 0) {
		if (ball_x < 10 || ball_x + ball_size > 310) {
			if ((*cur_board).y2 + 5 >= ball_y - ball_size)
				return;
		}
		int prev = (*cur_board).y1;
		if ((*cur_board).y1 + 5 > 240 || (*cur_board).y2 + 5 > 240)
			return;
		(*cur_board).y1 += 5;
		(*cur_board).y2 += 5;
		for (int i = (*cur_board).x1; i <= (*cur_board).x2; i++) {
			for (int j = prev; j <= (*cur_board).y2; j++) {
				plot_pixel(i, j, background[i + j * 320]);
			}
		}
		draw(board, (*cur_board).y1, (*cur_board).x1, 50, 7);
	}
	else if (direction == 1) {
		if (ball_x < 10 || ball_x + ball_size > 310) {
			if ((*cur_board).y2 - 5 <= ball_y)
				return;
		}
		int prev = (*cur_board).y2;
		if ((*cur_board).y1 - 5 < 0 || (*cur_board).y2 - 5 < 0)
			return;
		(*cur_board).y1 -= 5;
		(*cur_board).y2 -= 5;
		for (int i = (*cur_board).x1; i <= (*cur_board).x2; i++) {
			for (int j = (*cur_board).y2; j <= prev; j++) {
				plot_pixel(i, j, background[i + j * 320]);
			}
		}
		draw(board, (*cur_board).y1, (*cur_board).x1, 50, 7);
	}
}

int byte0 = 0, byte1 = 0, byte2 = 0;
int key_pressed() {
	int PS2_data, RVALID;
	while (1) {
		PS2_data = *(PS2_ptr);
		RVALID = PS2_data & 0x8000;
		if (RVALID) { //32809 is num stored in PS2_data if space is pressed
			byte0 = byte1;
			byte1 = byte2;
			byte2 = PS2_data & 0xFF;
			if ((byte1 == (int)0x1D) && (byte2 == (int)0xF0)) {
				return 1;
			}
			else if ((byte1 == (int)0x1B) && (byte2 == (int)0xF0)) {
				return 0;
			}
			else if ((byte1 == (int)0x43) && (byte2 == (int)0xF0)) {
				return 3;
			}
			else if ((byte1 == (int)0x42) && (byte2 == (int)0xF0)) {
				return 2;
			}
			else if ((byte1 == (int)0x29) && (byte2 == (int)0xF0)) {
				return 4;
			}
			else if (byte2 == (int)0xF0) {
				return -1;
			}
		}
		else {
			return -1;
		}
	}
}

void set_ball_direction() {
	int temp = rand() % 2;
	if (temp)
		dx = 1;
	else
		dx = -1;
	temp = rand() % 2;
	if (temp)
		dy = 1;
	else
		dy = -1;
}

void move_ball() {
	for (int i = ball_x; i <= ball_x + ball_size; i++) {
		for (int j = ball_y; j <= ball_y + ball_size; j++) {
			plot_pixel(i, j, background[i + j * 320]);
		}
	}

	ball_x += dx;
	ball_y += dy;

	if (ball_y < 0 || ball_y + ball_size >= 240) {
		dy = -dy; // Reverse vertical direction
		ball_y += dy;
	}

	for (int i = 0; i < ball_size; i++) {
		for (int j = 0; j < ball_size; j++) {
			if ((i - ball_size / 2) * (i - ball_size / 2) + (j - ball_size / 2) * (j - ball_size / 2) <= (ball_size / 2) * (ball_size / 2))
				plot_pixel((int)(ball_x + i), (int)(ball_y + j), ball_colour);
		}
	}
}

void display_score(int player, int index) {
	int score[6] = { 0b00111111, 0b00000110, 0b01011011, 0b01001111 };
	// score array stores codes to display numbers 0 - 3 in the hex display 
	if (player == 0) {
		*ADDR_7SEG1 = score[index];
	}
	else {
		*ADDR_7SEG2 = score[index];
	}
	return;
}

void clear_screen() {
	int y, x;
	for (x = 0; x < 320; x++) {
		for (y = 0; y < 240; y++) {
			plot_pixel(x, y, 0);
		}
	}
}

void plot_pixel(int x, int y, short int line_color) {
	volatile short* _vga_addr = (volatile short*)(0x08000000 + (y << 10) + (x << 1));
	*_vga_addr = line_color;
}

void draw(const int array[], int xbuffer, int ybuffer, int x, int y) {
	int i;
	int j;
	for (i = 0; i < y; i++) {
		for (j = 0; j < x; j++) {
			plot_pixel(i + ybuffer, j + xbuffer, array[j * y + i]);
		}
	}
}

